export function genFields(mlbStats) {
    if (mlbStats == null) return {"stats": [], "info": []}
    let stats = []
    let info = []
    mlbStats.map(team => {
        team.map((key, value) => {
            console.log(key, value)
        })
    })

    return {"stats": stats, "info": info}
}
